import React from 'react';
import Experience from './Experience';
import Skills from './Skills';
import './App.css';

function App() {
    return (
        <div className="App">
            <h1>Portfolio of Vishnu</h1>
            <Experience />
            <Skills />
        </div>
    );
}

export default App;
